import React, { Component } from 'react';
// import {connect} from 'react-redux';
// import StrAddButton from '../StrAddButton';
import { Route } from "react-router-dom";
import content from './R095_reactThrottle'
import '../App.css';
import 'bootstrap/dist/css/bootstrap.css';
import floatingPopulationList from './Floating_population/floatingPopulationList';

// css
import '../css/new.css';

// header
import HeaderAdmin from './Header/Header_admin';

// footer
import Footer from './Footer/Footer';

// login
import LoginForm from './LoginForm';

class App extends Component {
  render() {
    return (
      <div className="App">
        <HeaderAdmin />
        <Route exact path='/' component={LoginForm} />
        <Route exact path='/Debounce' component={content} />
        <Route path='/floatingPopulationList' component={floatingPopulationList} />
        <Footer />
      </div>
      // <div>
      //   <h1>react 시작</h1>
      //   <p>html 적용</p>
      //   {/* <span>{this.props.store.getState().data.str}</span><br/>
      //   <StrAddButton store={this.props.store}/> */}

      //   {/* <span>{this.props.str}</span><br/>
      //   <StrAddButton AppProp="200"/> */}
      // </div>
    );
  }
}

// let mapStateToProps = (state, props) => {
//   console.log("props from index.js : "+props.indexProp)
//   return {
//     str : state.data.str,
//   }
// }

// App = connect(mapStateToProps, null)(App);

export default App;
